import React from 'react';
import s from './Card.module.css'

export default function Card(props) {
  // ac치 va tu c칩digo
  return (
  <div className={`${s.card}`}>
    <div className={`${s.content}`}>
      <p className={`${s.city}`}>{props.name}</p>
      <button className={`${s.button}`} onClick={props.onClose}>X</button>
      <p className={`${s.temp}`}>Min: {props.min} </p>
      <p className={`${s.temp}`}>Max: {props.max}</p> 
      <img className={`${s.img}`} src={`http://openweathermap.org/img/wn/${props.img}@2x.png`} alt={'img'}/>
    </div>
  </div>
  )
};
